import React from 'react'
import { menu } from './Menu'

let count = 0

const BoilerPlate = () => {
  return (
    <div className='w-full text-white'>
      <h2 className="font-black text-3xl py-8">Links</h2>
      <ul className='bg-[rgba(0,0,0,0.2)] mb-16 text-lg'>

        {
            menu.map(item => {
               return (
                 <li key={count--}>
                    <a href={item.link} className='hover:text-cyan-300 hover:underline'>
                        {item.title}
                    </a>
                </li>
               )
            })
        }
      </ul>
    </div>
  )
}

export default BoilerPlate
